import React, { useContext, useEffect, useState } from "react";

import Badge from "react-bootstrap/Badge";
import ListGroup from "react-bootstrap/ListGroup";

import { DataContext } from "../../App/index.jsx";

import getPriceStock from "../../Services/index.js";

const ListHistory = () => {
  const { 
    state,
    setState,
    firtsSearch,
    setFirtsSearch, } = useContext(DataContext);

  useEffect(() => {

    const fetchData = async () => {
      const res = await getPriceStock('');

      if (firtsSearch) {
        setState(res.data);
      }
    }

    fetchData();
  }, []);

  const data = Object.keys(state).map(key => ({ key, value: state[key] }));
  const priceLs = data.map(item => item.value);

  const isStateEmpty = () => {
    return priceLs === null;
  };

  return (
    <>
      {isStateEmpty() ? (
        <ListGroup as="ol" numbered>
          <ListGroup.Item
            as="li"
            className="d-flex justify-content-between align-items-start"
          >
            <div className="ms-2 me-auto">
              <div className="fw-bold">dwadwad</div>
              Cras justo odi
            </div>
            <Badge bg="primary" pill>
              14
            </Badge>
          </ListGroup.Item>
        </ListGroup>
      ) : (
        <ListGroup as="ol" numbered>
          {priceLs.map((item) => (
            <ListGroup.Item
              as="li"
              className="d-flex justify-content-between align-items-start"
              key={item.id}
            >
              <div className="ms-2 me-auto">
                <div className="fw-bold">{item.value.symbol} {item.date}</div>
                {item.last}
              </div>
              <Badge bg="primary" pill>
                14
              </Badge>
            </ListGroup.Item>
          ))}
        </ListGroup>
      )}
    </>
  );
};

export default ListHistory;
